BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "buildings" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "number" integer, "address" varchar(255), "description" varchar(255), "latitude" float, "longitude" float, "code" varchar(255), "created_at" datetime, "updated_at" datetime);
DELETE FROM sqlite_sequence;
CREATE TABLE "interests" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "marker_icon" varchar(255), "latitude" float, "longitude" float, "url" varchar(255), "description" varchar(255), "created_at" datetime, "updated_at" datetime, "picture" varchar(255), "category_id" integer);
CREATE TABLE "categories" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "description" varchar(255), "default_marker" varchar(255), "source" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;
